runtime: java11
inbound_services:
- warmup
derived_file_type:
- java_precompiled
auto_id_policy: default
handlers:
- url: /
  script: unused
  login: optional
  secure: optional
- url: /_ah/.*
  script: unused
  login: optional
  secure: optional
- url: /rest
  script: unused
  login: optional
  secure: optional
- url: .*\.jsp
  script: unused
  login: optional
  secure: optional
- url: /.*/
  script: unused
  login: optional
  secure: optional
- url: /rest/.*
  script: unused
  login: optional
  secure: optional
